const form=document.querySelector("form");form.addEventListener("submit",(function(t){t.preventDefault(),console.log("stripe");const e=[];document.querySelectorAll("[data-item-id][data-item-quantity").forEach((t=>{const o=t.dataset.itemId,n=t.dataset.itemQuantity;e.push({id:parseInt(o),quantity:parseInt(n)})})),fetch("https://alvinspizzeria.onrender.com/create-checkout-session",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({items:e})}).then((t=>t.ok?t.json():t.json().then((t=>Promise.reject(t))))).then((({url:t})=>{window.location=t})).catch((t=>{console.error(t.error)}))}));